script: |
  super -f text -I q7399.spq | sort > q7399.out

inputs:
  - name: q7399.spq
    data: |
      SELECT * FROM tab0 (FORMAT parquet) WHERE NOT ( ( - col2 ) ) BETWEEN col0 + - - 20 + + 65 * + 93 + - col2 / - 81 AND 9;
  - name: tab0

outputs:
  - name: q7399.out
    data: |
      15	81	47
      87	21	10
      97	1	99
